css:
:root {
  font-size: 16px;
}
.conflict-resolved {
  background: rgba(0, 150, 136, 0.1);
}
.conflict-ours {
  background: rgba(200, 227, 170, 0.4);
}
.conflict-ours.cursor-line {
  background: rgba(200, 227, 170, 0.3);
}
.conflict-theirs {
  background: rgba(154, 207, 250, 0.4);
}
.conflict-theirs.cursor-line {
  background: rgba(154, 207, 250, 0.3);
}
.conflict-base {
  background: rgba(255, 240, 110, 0.4);
}
.conflict-base.cursor-line {
  background: rgba(255, 240, 110, 0.3);
}
.conflict-dirty {
  background: rgba(255, 235, 59, 0.4);
}
.conflict-dirty.cursor-line {
  background: rgba(255, 235, 59, 0.3);
}
